(async()=>{const t=await fetch("https://api.github.com/repos/avikboss/avikboss.github.io/commits").then(t=>t.json()),e=new Date(t[0].commit.author.date);let o=document.getElementById("date");o.innerHTML=`Updated ${new Intl.DateTimeFormat(void 0,{month:"long",year:"numeric"}).format(e)}`,o.href=t[0].html_url})();